common:
  api_name: elara_healthcarescribe
  api_version: v1
  organization_name: google
  proto_deps:
    - name: google-common-protos
  src_proto_paths:
  - v1alpha
  service_yaml: elara.yaml
  gapic_yaml: v1alpha/elara_healthcarescribe_gapic.yaml
artifacts:
- name: gapic_config
  type: GAPIC_CONFIG
- name: java_gapic
  type: GAPIC
  language: JAVA
- name: python_gapic
  type: GAPIC
  language: PYTHON
- name: nodejs_gapic
  type: GAPIC
  language: NODEJS
- name: php_gapic
  type: GAPIC
  language: PHP
- name: go_gapic
  type: GAPIC
  language: GO
- name: ruby_gapic
  type: GAPIC
  language: RUBY
- name: csharp_gapic
  type: GAPIC
  language: CSHARP
